INSERT INTO public.product (id, name, created_at, updated_at, price, category_id, is_relative, weight, description_short, description, color, discount, availability, infomation, is_featured, slug, count, rated, reviews) VALUES (2, 'Pork Center Cut Loin Chops Bone-In Family Pack', '2022-07-18 04:31:28.193635+00', '2022-07-18 04:31:28.193635+00', 5, 1, false, 5.2000, 'One Family Pack of Bone-In Pork Center Cut Loin Chops', 'There''s nothing like cooking from scratch, especially when you start with fresh Bone-In Pork Center Cut Loin Chops. Made with quality cuts of USDA inspected pork, our fresh pork chops are juicy, flavorful and perfect for all of your favorite spice rubs and marinades. Fresh and ready to cook, our pork is an excellent source of protein and is a delicious addition to any recipe. Simply prepare with a balsamic vinaigrette and serve with seasoned rice and steamed peas for a delicious weeknight dinner. Includes one Family Pack of Bone-In Pork Center Cut Loin Chops', 'RED', 2, true, 'There''s nothing like cooking from scratch, especially when you start with fresh Bone-In Pork Center Cut Loin Chops. Made with quality cuts of USDA inspected pork, our fresh pork chops are juicy, flavorful and perfect for all of your favorite spice rubs and marinades. Fresh and ready to cook, our pork is an excellent source of protein and is a delicious addition to any recipe. Simply prepare with a balsamic vinaigrette and serve with seasoned rice and steamed peas for a delicious weeknight dinner. Includes one Family Pack of Bone-In Pork Center Cut Loin Chops', true, NULL, 4, 7, 24);
INSERT INTO public.product (id, name, created_at, updated_at, price, category_id, is_relative, weight, description_short, description, color, discount, availability, infomation, is_featured, slug, count, rated, reviews) VALUES (3, 'Fresh Sweet Rainier Cherries', '2022-07-18 04:34:35.819592+00', '2022-07-18 04:34:35.819592+00', 10.4600, 3, true, 1.2500, '5.0 servings per container', 'This golden yellow cherry with a red blush has a crisp bite and delicate super-sweet flavor. Rainiers hae some of the highest sugar levels of sweet cherries, ranging from 17-23 brix. It''s best to enjoy rainier cherries just as they are, but if you want to fancy them up, then we recommend slicing them into a salad. Enjoy the sweet taste of summer with delicious rainier cherries', 'RED', 2, true, 'This golden yellow cherry with a red blush has a crisp bite and delicate super-sweet flavor. Rainiers hae some of the highest sugar levels of sweet cherries, ranging from 17-23 brix. It''s best to enjoy rainier cherries just as they are, but if you want to fancy them up, then we recommend slicing them into a salad. Enjoy the sweet taste of summer with delicious rainier cherries', true, NULL, 4, 6, 3);
INSERT INTO public.product (id, name, created_at, updated_at, price, category_id, is_relative, weight, description_short, description, color, discount, availability, infomation, is_featured, slug, count, rated, reviews) VALUES (5, 'Fresh Tilapia Fillet', '2022-07-18 04:38:09.632043+00', '2022-07-18 04:38:09.632043+00', 4, 5, false, 2, 'Refer to the product label for full dietary information, which may be available as an alternative product image.', 'This Fresh Tilapia Fillet, are responsibly sourced, never frozen and always ready to cook! Tilapia is a very popular seafood across the U.S. because of its mild flavor and delicate, flaky texture when cooked. It is also a lean source of protein with only two grams of fat per serving. The tilapia are raised in large floating pens within vast lakes, allowing the fish to swim without crowding against water current like wild fish. They are only sourced from BAP certified suppliers. These tilapia fillets are skinless and extremely versatile. They can be pan fried, steamed, smoked, grilled or even baked and are a great seafood choice for you and your family. No matter how you prepare them, the Fresh Tilapia Fillet are an excellent meal for your family.', 'WHITE', 5, true, NULL, true, NULL, 5, 6, 3);
INSERT INTO public.product (id, name, created_at, updated_at, price, category_id, is_relative, weight, description_short, description, color, discount, availability, infomation, is_featured, slug, count, rated, reviews) VALUES (6, 'Great Value Cage Free Extra Large AA White Eggs', '2022-07-18 04:40:18.379834+00', '2022-07-18 04:40:18.379834+00', 3.6700, 6, false, NULL, 'Great Value Cage', 'Great Value Cage Free Extra Large Eggs are a delicious addition to your kitchen. They''re very versatile and an essential ingredient in many recipes, including baking, omelettes, French toast and more. These Extra Large Grade AA eggs are ideal for hard boiling or serving up deviled style. They cook up nice and fluffy when scrambled. They''re a good source of protein and are 80 calories per serving each. These eggs come in packaging made from recyclable material to be a more eco-friendly option for your home or business. The culinary possibilities are virtually endless when you choose Great Value Cage Free Extra Large AA White Eggs.', 'WHITE', 5, NULL, NULL, true, NULL, 12, 4, 9);
INSERT INTO public.product (id, name, created_at, updated_at, price, category_id, is_relative, weight, description_short, description, color, discount, availability, infomation, is_featured, slug, count, rated, reviews) VALUES (7, 'Ore-Ida Extra Crispy Fast Food French Fries Fried Frozen Potatoes', '2022-07-18 05:17:16.805993+00', '2022-07-18 05:17:16.805993+00', 4, 7, false, 1, 'Ore-Ida Extra Crispy Fast Food Fries make it easy to enjoy delicious fast food style fries at home. Crispy and golden, these Grade A fries are made from freshly peeled, American grown potatoes. These gluten free fries offer an extra crispy outside with a fluffy inside for the perfect blend of textures to make your next family meal a success. Toss these frozen fries on a baking sheet to bake them in the oven according to package instructions for perfectly crispy fries every time. An American classic, these easy fries are cut thin and straight like fast food fries for extra crispness and are perfect for dipping. Serve these fries with the traditional burger, or get creative with loaded fries topped with cheese and bacon. These oven baked fries come sealed in a 26 ounce bag to help lock in flavor. Your family deserves the highest quality because if it''s not Grade A, it''s not Ore-Ida!', 'Ore-Ida Extra Crispy Fast Food Fries make it easy to enjoy delicious fast food style fries at home. Crispy and golden, these Grade A fries are made from freshly peeled, American grown potatoes. These gluten free fries offer an extra crispy outside with a fluffy inside for the perfect blend of textures to make your next family meal a success. Toss these frozen fries on a baking sheet to bake them in the oven according to package instructions for perfectly crispy fries every time. An American classic, these easy fries are cut thin and straight like fast food fries for extra crispness and are perfect for dipping. Serve these fries with the traditional burger, or get creative with loaded fries topped with cheese and bacon. These oven baked fries come sealed in a 26 ounce bag to help lock in flavor. Your family deserves the highest quality because if it''s not Grade A, it''s not Ore-Ida!', 'YELLOW', 4, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO public.product (id, name, created_at, updated_at, price, category_id, is_relative, weight, description_short, description, color, discount, availability, infomation, is_featured, slug, count, rated, reviews) VALUES (8, 'Yellow Onions, Each', '2022-07-18 05:19:09.551726+00', '2022-07-18 05:19:09.551726+00', 0.9900, 8, false, 1, 'Get ready to roast, caramelize, and grill these Yellow Onions to absolute perfection! Thanks to their mild, all-purpose flavor, sweet onions are known to be less pungent than other varieties of onions, making them a lovely choice when it comes to salads, relishes, and so much more. Whip up an onion confit for serving atop meats or pizzas, roast a few slices to stack on sandwiches or burgers, or dip into a batter and deep-fry until they turn into golden onion rings. Plus, these onions are packed with nutrients, so you can feel good about eating them. Get ready for some delicious dishes with our Yellow Onions.', 'Get ready to roast, caramelize, and grill these Yellow Onions to absolute perfection! Thanks to their mild, all-purpose flavor, sweet onions are known to be less pungent than other varieties of onions, making them a lovely choice when it comes to salads, relishes, and so much more. Whip up an onion confit for serving atop meats or pizzas, roast a few slices to stack on sandwiches or burgers, or dip into a batter and deep-fry until they turn into golden onion rings. Plus, these onions are packed with nutrients, so you can feel good about eating them. Get ready for some delicious dishes with our Yellow Onions.', 'YELLOW', 1, true, NULL, true, NULL, 5, 3, 5);
INSERT INTO public.product (id, name, created_at, updated_at, price, category_id, is_relative, weight, description_short, description, color, discount, availability, infomation, is_featured, slug, count, rated, reviews) VALUES (9, 'Fresh Papaya, Size Varies', '2022-07-18 05:25:02.882807+00', '2022-07-18 05:25:02.882807+00', 4, 9, false, NULL, 'Get flavor and nutrition with our Fresh Solo Papaya. Papaya is a tropical fruit that originated in the tropics of the Americas and is known to be a great source of vitamins C, A, fiber, and antioxidants. When ripe, this fruit has a butter-like texture with a fairly sweet flavor similar to cantaloupe and can be eaten raw, without skin or seeds. Papaya can be prepared in a variety of ways; you can mix them with grapefruit and avocado for a bright summer salad, add them to a zesty salsa for some sweetness, freeze them and turn them into refreshing popsicle spears, or bake them in the oven with a melted brown sugar mixture. The sky''s the limit! Get ready for a taste-bud party with Fresh Solo Papaya.', 'Get flavor and nutrition with our Fresh Solo Papaya. Papaya is a tropical fruit that originated in the tropics of the Americas and is known to be a great source of vitamins C, A, fiber, and antioxidants. When ripe, this fruit has a butter-like texture with a fairly sweet flavor similar to cantaloupe and can be eaten raw, without skin or seeds. Papaya can be prepared in a variety of ways; you can mix them with grapefruit and avocado for a bright summer salad, add them to a zesty salsa for some sweetness, freeze them and turn them into refreshing popsicle spears, or bake them in the oven with a melted brown sugar mixture. The sky''s the limit! Get ready for a taste-bud party with Fresh Solo Papaya.', 'YELLOW', 1, true, 'Get flavor and nutrition with our Fresh Solo Papaya. Papaya is a tropical fruit that originated in the tropics of the Americas and is known to be a great source of vitamins C, A, fiber, and antioxidants. When ripe, this fruit has a butter-like texture with a fairly sweet flavor similar to cantaloupe and can be eaten raw, without skin or seeds. Papaya can be prepared in a variety of ways; you can mix them with grapefruit and avocado for a bright summer salad, add them to a zesty salsa for some sweetness, freeze them and turn them into refreshing popsicle spears, or bake them in the oven with a melted brown sugar mixture. The sky''s the limit! Get ready for a taste-bud party with Fresh Solo Papaya.', true, NULL, 1, 10, 10);
