INSERT INTO public.product (id, name, created_at, updated_at, price, category_id, is_relative, weight, description_short, description, color, discount, availability, infomation, is_featured, slug, count, rated, reviews) VALUES (11, 'Organic Bananas, Bunch', '2022-07-18 05:28:29.53744+00', '2022-07-18 05:28:29.53744+00', 1.7000, NULL, false, NULL, 'Enjoy the sweet, tropical taste of Organic Bananas. Bananas are a good source of several vitamins and minerals including potassium, vitamin B6 and vitamin C and are low in sodium. Enjoy them at breakfast, lunch, dessert, or anytime you want a healthy snack. Use them to make a loaf of moist banana bread and enjoy with a hot cup of coffee in the mornings or layer them with pudding and vanilla wafer cookies for a light, sweet banana pudding that''s perfect for dessert. Simply peel open the banana and savor the delicious taste of this sweet fruit. Bring home Organic Bananas and make them a part of your day.', 'Enjoy the sweet, tropical taste of Organic Bananas. Bananas are a good source of several vitamins and minerals including potassium, vitamin B6 and vitamin C and are low in sodium. Enjoy them at breakfast, lunch, dessert, or anytime you want a healthy snack. Use them to make a loaf of moist banana bread and enjoy with a hot cup of coffee in the mornings or layer them with pudding and vanilla wafer cookies for a light, sweet banana pudding that''s perfect for dessert. Simply peel open the banana and savor the delicious taste of this sweet fruit. Bring home Organic Bananas and make them a part of your day.', 'YELLOW', 0, NULL, NULL, true, NULL, 1, 7, 6);
INSERT INTO public.product (id, name, created_at, updated_at, price, category_id, is_relative, weight, description_short, description, color, discount, availability, infomation, is_featured, slug, count, rated, reviews) VALUES (4, '1 lb Fresh Strawberries', '2022-07-18 04:36:19.246377+00', '2022-07-18 05:33:32.357613+00', 2.3800, 4, true, 1, 'Perfectly sweet every time', 'Prior to serving, rinse strawberries gently and remove the leafy caps when you have finished washing them. When handled and stored properly at home, strawberries can stay fresh 3-7 days after purchase. Refrigerating strawberries helps them last longer.  We keep our berries refrigerated and highly recommend you keep them in the original container and refrigerate them as soon as possible as well.  Do not wash them prior to refrigeration. How to Freeze: 1. Gently rinse strawberries with cool water 2. Cut the green caps off the top of each berry 3. Pat lightly with a towel to soak up access water 4. Allow time for the berries to thoroughly dry 5. Evenly lay berries flat side down on a cookie sheet 6. Place cookie sheet into the freezer for approximately 2 hours; or until berries are completely frozen 7. Transfer frozen berries into large plastic zipper bag and seal tightly 8. Write the date on the plastic bag and store in freezer', 'RED', 1, true, 'Prior to serving, rinse strawberries gently and remove the leafy caps when you have finished washing them. When handled and stored properly at home, strawberries can stay fresh 3-7 days after purchase. Refrigerating strawberries helps them last longer.  We keep our berries refrigerated and highly recommend you keep them in the original container and refrigerate them as soon as possible as well.  Do not wash them prior to refrigeration. How to Freeze: 1. Gently rinse strawberries with cool water 2. Cut the green caps off the top of each berry 3. Pat lightly with a towel to soak up access water 4. Allow time for the berries to thoroughly dry 5. Evenly lay berries flat side down on a cookie sheet 6. Place cookie sheet into the freezer for approximately 2 hours; or until berries are completely frozen 7. Transfer frozen berries into large plastic zipper bag and seal tightly 8. Write the date on the plastic bag and store in freezer', true, NULL, 6, 6, 6);
